import React, { Component } from 'react';

class RestauranstCreate extends Component {

    create()
    {
        console.log(this.state)
    }
    render() {
        return (
            <div>
                Restaurants Create
                <div>
                    <input onChange={(event) => { this.setState({ name: event.target.name }) }} placeholder="Restaurant name" />
                    <br></br>
                    <input onChange={(event) => { this.setState({ adr: event.target.adr }) }} placeholder="Restaurant Adr" />
                    <br></br>
                    <input onChange={(event) => { this.setState({ email: event.target.email }) }} placeholder="Restaurant Email" />
                    <br></br>
                    <input onChange={(event) => { this.setState({ rating: event.target.rating }) }} placeholder="Restaurant Rating" />
                    <br></br>


                    <button onClick ={()=>(this.create())}>Add Restaurant</button>

                </div>

            </div>
        );
    }
}

export default RestauranstCreate;
